import React from "react";
import PropTypes from "prop-types";

export const GifGrid = ({ categories }) => {
  console.log(categories);
  return (
    <div>
      {categories && <h1>{categories}</h1>}
      {!categories && <h1>No hay categorias</h1>}
    </div>
  );
};

GifGrid.propTypes = {
    categories: PropTypes.string,
};
